import React from "react";
import "./style.css";

const CardFront = ({ coverImage, numberphone, name, genre, patientLength }) => {
  return (
    <div className="front">
      <img src={coverImage} alt="coverImage" />
      <div className="card-footer">
        <h4> {name} </h4>
        <p>
          {patientLength} / {genre}
        </p>
      </div>
      <span className="like"> {numberphone}</span>
    </div>
  );
};
export default CardFront;
